}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16">  <path d="M16,15H0V1H7V3l9-.0049ZM1,14H15V3.9956L6,4V2H1Z" class="aw-theme-iconOutline" fill="#464646"/></svg>';
        export const SvgComponent = React.memo(SvgComp);
